func latestTimeCatchTheBus(buses []int, passengers []int, capacity int) int {
	// sortBuses := SortList(buses)
	// sortPassengers := SortList(passengers)
	sort.Ints(buses)
	sort.Ints(passengers)
	// println("-----")
	// log.Printf("%v \n", sortBuses)

	residue := []int(passengers)
	// 
	busMap := make(map[int][]int, 0)
	if isPrintLog {
		log.Printf("sortBuses %v \n", buses)
	}
	for _, v := range buses {
		// newResidue := make([]int, 0)
		// 
		if needLen := capacity - len(residue); needLen > 0 {
			fill := make([]int, needLen)
			residue = append(fill, residue...)
		}
		newResidue := residue[capacity:]
		// 
		for _, vv := range residue[:capacity] {
			// 0  
			if vv == 0 {
				continue
			}
			// 
			waitQue := []int{}
			if vv <= v {
				busMap[v] = append(busMap[v], vv)
			} else {
				// 
				waitQue = append(waitQue, vv)
			}
			newResidue = append(waitQue, newResidue...)
		}
		residue = newResidue
	}

	if isPrintLog {
		log.Printf("%v \n", busMap)
		log.Printf("%v \n", busMap[buses[len(buses)-1]])
	}
	// 
	lastPassengres := busMap[buses[len(buses)-1]]
	// map    ?
	// sort.Ints(lastPassengres)
	res := 0
	// bus 
	if len(lastPassengres) < capacity {
		// bus 
		res = buses[len(buses)-1]
	} else {
		// bus 
		res = lastPassengres[len(lastPassengres)-1] - 1
	}
	//  -1
	// 
	for i := (len(passengers) - 1); i >= 0; i-- {
		if res == passengers[i] {
			res--
		}
	}
	return res
}

