type SortList []int

func (a SortList) Len() int {
	return len(a)
}

func (a SortList) Less(i, j int) bool {
	return a[i] < a[j]
}

func (a SortList) Swap(i, j int) {
	a[i], a[j] = a[j], a[i]
}

